transforms.result:
.search-bar {
    &__search {
      display: flex;
      align-items: center;
      gap: 4px;
      margin-bottom: 16px;
      max-width: 30%
    }
  
    &__search-input {
      width: 100%;
      border-radius: 8px;
      border: 1px solid teal;
      padding: 4px 8px;
      outline: none;
      :focus {
        border: 2px solid teal;
      }
    }
}
